To be completely honest, I’m not sure how to articulate how I feel about what is going on in the world right now. I don’t have the answers, however, I do have a long-standing belief in the strength and power of kindness. And that’s where I’m going to concentrate my voice. 
Kindness is defined as the quality of being friendly, generous, helpful, and considerate. And there is no doubt that it is one of the invisible global currencies of happiness, health, and success in all areas of life in this world we live in.

