For so long, I had a vision of creating a safe place for women that could serve as a sisterhood. 
I had no idea that when this opportunity came into my life, it would help me create just that- to connect and reconnect with women from all walks of life. 
All of us have a different story to tell but share the same vision. 
And it’s through this community, we find the courage and support to step into our power 💖 💪🏽and serve with purpose.
